import React, { useState, useEffect } from "react";
import logo from "../../images/logo.png";
import "../../styles/navlink.css";

const Navpar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Fetch user profile data from the server
    fetch('/profile', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
      },
      credentials: 'include', // Include cookies in request
    })
    .then(response => {
      if (response.status === 200) {
        return response.json();
      } else {
        throw new Error('Not authenticated');
      }
    })
    .then(data => {
      setUser(data.user);
    })
    .catch(error => {
      console.error('Error:', error);
    });
  }, []);

  const handleCardClick = (route) => {
    window.location.href = route;
  };

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  const handleLogout = () => {
    fetch('/logout', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      credentials: 'include', // Include cookies in request
    })
    .then(response => {
      if (response.status === 200) {
        setUser(null); // Clear user state
        window.location.href = '/login'; // Redirect to login page
      } else {
        throw new Error('Logout failed');
      }
    })
    .catch(error => {
      console.error('Error:', error);
    });
  };

  return (
    <nav className="nav-container">
      <div className="nav-content">
        <div className="logo-container">
          <img src={logo} alt="" className="logo" />
        </div>
        <div className={`nav-links ${isOpen ? "hidden md:flex" : "md:flex"}`}>
          <div className="nav-link" onClick={() => handleCardClick("/landingpage")}>
            Home
          </div>
          <div className="nav-link" onClick={() => handleCardClick("/About")}>
            About
          </div>
          <div className="nav-link" onClick={() => handleCardClick("/Services")}>
            Services
          </div>
          <div className="nav-link" onClick={() => handleCardClick("/Contact")}>
            Contact
          </div>
          <div className="nav-link" onClick={() => handleCardClick("/Blog")}>
            Blog
          </div>
          {user ? (
            <>
              <div className="nav-link">
                {user.firstname} {user.lastname}
              </div>
              <div className="nav-link" onClick={handleLogout}>
                Logout
              </div>
            </>
          ) : null}
        </div>
        <div className="menu-toggle md-hidden">
          <button className="menu-button" onClick={toggleMenu}>
            <svg
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                d="M3 6h18M3 12h18M3 18h18"
                stroke="#000"
                strokeWidth="2"
                strokeLinecap="round"
                strokeLinejoin="round"
              />
            </svg>
          </button>
        </div>
      </div>
      {isOpen && (
        <div className="mobile-menu md-hidden">
          <div className="nav-link" onClick={() => handleCardClick("/About")}>
            About
          </div>
          <div className="nav-link" onClick={() => handleCardClick("/Contact")}>
            Contact
          </div>
          <div className="nav-link" onClick={() => handleCardClick("/Services")}>
            Services
          </div>
          <div className="nav-link" onClick={() => handleCardClick("/Blog")}>
            Blog
          </div>
          {user ? (
            <>
              <div className="nav-link">
                {user.firstname} {user.lastname}
              </div>
              <div className="nav-link" onClick={handleLogout}>
                Logout
              </div>
            </>
          ) : null}
        </div>
      )}
    </nav>
  );
};

export default Navpar;
